import React from "react";
import { Grid } from "@material-ui/core";
import Button from "@material-ui/core/Button";
export default function Buttons() {
  return (
    <>
      <Grid container>
        <Grid item>
          <Button variant="outlined" color="primary" href="#outlined-buttons">
            Link
          </Button>
        </Grid>
      </Grid>
    </>
  );
}
